var dbConn;

try {
	dbConn = DatabaseConnectionFactory.createDatabaseConnection('org.postgresql.Driver','jdbc:postgresql://localhost:5432/fhirtest','postgres','postgres');

	var type = $('fhirType');
	var id = UUIDGenerator.getUUID();
	var data = AttachmentUtil.reAttachMessage(connectorMessage);
	var versionId = '1';
	var contentType = $('contentType');

	var params = new Packages.java.util.ArrayList();
	params.add(type);
	params.add(id);
	params.add(data);
	params.add(versionId);
	params.add(contentType);

	dbConn.executeUpdate("INSERT INTO resource (name, id, data, version, mimetype) VALUES (?, ?, ?, ?, ?)", params);

	responseMap.put('response', FhirResponseFactory.getCreateResponse(id, versionId, 201));
} finally {
	if (dbConn) { 
		dbConn.close();
	}
}

var dbConn;

try {
	dbConn = DatabaseConnectionFactory.createDatabaseConnection('org.postgresql.Driver','jdbc:postgresql://localhost:5432/fhirtest','postgres','postgres');

	var data = AttachmentUtil.reAttachMessage(connectorMessage);
	var versionId = $('vid');
	var type = $('fhirType');
	var id = $('fhirId');
	var contentType = $('contentType');

	var params = new Packages.java.util.ArrayList();
	params.add(data);
	params.add(versionId);
	params.add(contentType);
	params.add(type);
	params.add(id);

	var result = dbConn.executeUpdate("UPDATE resource SET data = ?, version = ?, mimetype = ? WHERE name = ? AND id = ?", params);
	var responseCode;

	if (result == 0) {
		params = new java.util.ArrayList();
		params.add(type);
		params.add(id);
		params.add(data);
		params.add(versionId);
		params.add(contentType);

		dbConn.executeUpdate("INSERT INTO resource (name, id, data, version, mimetype) VALUES (?, ?, ?, ?, ?)", params);

		responseCode = 201;
	} else {
		responseCode = 200;
	}

	responseMap.put('response', FhirResponseFactory.getUpdateResponse(versionId, responseCode));
} finally {
	if (dbConn) { 
		dbConn.close();
	}
}

properties.script:
var dbConn;

try {
	dbConn = DatabaseConnectionFactory.createDatabaseConnection('org.postgresql.Driver', 'jdbc:postgresql://localhost:5432/fhirtest', 'postgres', 'postgres');

	var params = new Packages.java.util.ArrayList();
	params.add($('fhirType'));
	params.add($('fhirId'));

	var result = dbConn.executeCachedQuery("SELECT data, version, mimetype FROM resource WHERE name = ? AND id = ?", params);
	var response;

	if (result.next()) {
		response = FhirResponseFactory.getReadResponse(result.getString('data'), result.getString('version'), null, 200, result.getString('mimetype'));
	} else {
		response = FhirResponseFactory.getReadResponse(null, null, 410, null);
	}

	responseMap.put('response', response);
} finally {
	if (dbConn) { 
		dbConn.close();
	}
}

var dbConn;

try {
	dbConn = DatabaseConnectionFactory.createDatabaseConnection('org.postgresql.Driver', 'jdbc:postgresql://localhost:5432/fhirtest', 'postgres', 'postgres');

	var params = new Packages.java.util.ArrayList();
	params.add($('fhirType'));
	params.add($('fhirId'));
	params.add($('fhirVid'));

	var result = dbConn.executeCachedQuery("SELECT data, mimetype FROM resource WHERE name = ? AND id = ? AND version = ?", params);
	var response;

	if (result.next()) {
		response = FhirResponseFactory.getVreadResponse(result.getString('data'), 200, result.getString('mimetype'));
	} else {
		response = FhirResponseFactory.getVreadResponse('', 410, null);
	}

	responseMap.put('response', response);
} finally {
	if (dbConn) { 
		dbConn.close();
	}
}

